import React, { Component } from 'react';
class HOME extends Component {

    state ={
        count: 0
    }

    render() { 
    return <div><h1>{this.formatCount()}</h1><p>{5+8}</p></div>;
    }

    formatCount(){
        const {count} = this.state;
        return count === 0 ? Zero : count;
    }
    }
 
export default HOME;
